import React from "react";
import { analytics } from "../constants";

const Analytics = () => {
  return (
    <div className="w-full flex-1 flex justify-between items-center gap-4">
      {analytics.map((analytic) => {
        return (
          <div className="h-32 w-[50%] border border-slate-400 rounded-md"></div>
        );
      })}
    </div>
  );
};

export default Analytics;
